import React from 'react';
import {Link} from 'react-router-dom';

function ViewWriteStories() {
  return (
    <div>
      <Link to= "/viewWriteStories" >Home</Link>
        <img src = "./images/The_Refuge.jpg" id = "Normal_Ghibili_House" height = "150"  alt = "Ghibili_House"></img>

    </div>
  )
}

export default ViewWriteStories;
